import React from 'react';
import Forms from './Forms';
import './assets/scss/home.scss';

class Home extends React.Component {
    render() {
        return (
            <div>
                <div className="home-background"></div>
                <div className="home-background-overlay"></div>
                <div className="top-container">
                    <h1 className="home-header"> Selling a car? SELL IT TO ME! <br/> It's fast, easy, and legit! </h1>
                </div>
                <div className="home-row">
                    <div className="home-column" id="left-column">
                        <h2 className="header2"> How it works </h2>
                        <ol className="home-list-container">
                            <li className="home-list"> Enter information about your car </li>
                            <li className="home-list"> Get a estimated offer right away </li>
                            <li className="home-list"> Receive an official offer within 24 hrs </li>
                            <li className="home-list"> Let us pick up the car or deliver it to us </li>
                            <li className="home-list"> Get Cash! </li>
                        </ol>
                    </div>
                </div>

                <div className="main-column" id="right-column">
                    <Forms />
                </div>
            </div>
        )
    }
}

export default Home;
